import React, {Component} from 'react';

export default class ThankYou extends Component {
    render() {
        return (
            <div className="card mb-5">
                <div className="card-body">
                    <div style={{marginTop: 20}}>
                        <h3>Thank You!</h3>
                    </div>
                </div>
            </div>
        )
    }
}
